export default {
  // 此处编写的就是 Vue组件实例的 配置项，通过一定语法，可以直接混入到组件内部
  // data methods computed 生命周期函数
  // 注意点：如果此处 和组件内，提供了同名的 data 或 methods，则组件内优先级更高。
  data () {
    return {
      title: '标题'
    }
  },
  methods: {
    sayHi () {
      console.log('(*´▽｀)')
    }
  }
}
